  [],\n\t\"revision_timestamp\": \"2015-05-07T03:50:29.569582\",\n\t\"name\": \"differential-photoacoustic-particle-absorption-monitor-project-80492\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"We developed a highly sensitive and compact
  instrument to directly measure particulate matter (PM) optical absorption. This
  device is based on differential photoacoustic absorption spectroscopy (DPAS) technique,
  which is capable of eliminating background interference from gaseous NO2 and engine
  acoustic noise. This method significantly improves detection sensitivity compared
  to the single-cell photoacoustic technique. Over the currently used filter-based
  measurement techniques, it has the following technical advantages:rn  1) Direct
  PM absorption detectionrn  2) Real-time measurement systemrn  3) Low background
  noisern  4) Low-cost commercial components\",\n\t\"license_title\": \"U.S. Government
